    <div className="header">
        <Link className='logo-container' to='/'>
            <Logo className="logo"></Logo>
        </Link>
        <div className="options">
            <Link className="options" to='/shop'>
                SHOP
            </Link>
            <Link className="options" to='/contact'>
                CONTACT
            </Link>
        </div>
    </div>
)

export default Header;
